import React from "react";
import "./about.css";

const about = (props) => {
  return (
    <>
      <div className="about">
        <img src="./imgs/Aboutimg1.jpeg" alt="....." srcSet="" />
        <h1>About Section</h1>
      </div>
    </>
  );
};

export default about;
